//will display product images with marquee animation. 
import React from 'react';
import ProductCard from './ProductCard.jsx'

//responsible for rendering the ProductCard Component. 


const ProductsDisplay = (props) =>  {
  const productUrls = props.productUrls 
  const productImages = []

  console.log(productUrls)

  for (let i = 0; i < productUrls.length; i++) {
    productImages.push(<ProductCard key={i} src={productUrls[i]} alt=" "/>)
  }

  return( 
   <div> 
     <ProductCard productUrls={props.productUrls} /> 
     {productImages}
   </div> 
 )
}




export default ProductsDisplay;
